import React, { useState } from "react";
import Navbar from "../../Components/navbar/navbar";
import "./Signup1.css";
import Box from "@mui/material/Box";
import InputLabel from "@mui/material/InputLabel";
import MenuItem from "@mui/material/MenuItem";
import FormControl from "@mui/material/FormControl";
import Select from "@mui/material/Select";

function Signup1() {
  // State to manage account type
  const [accountType, setAccountType] = useState("");

  // Handle dropdown change
  const handleChange = (event) => {
    const selectedValue = event.target.value;
    setAccountType(selectedValue);

    // Pass the value to the backend (example)
    console.log("Selected Account Type:", selectedValue);
    // Add your backend API call here
    // fetch("/api/accountType", {
    //   method: "POST",
    //   headers: { "Content-Type": "application/json" },
    //   body: JSON.stringify({ accountType: selectedValue }),
    // });
  };

  return (
    <>
      <Navbar />
      <h1>Let's Get Started</h1>
      <section className="signup-main">
        <h2>Get Started</h2>
        <h3>What is your account type?</h3>
        <div className="custom-select">
          <Box
            sx={{
              minWidth: 300,
              margin: "0 auto",
              textAlign: "left",
              backgroundColor: "#FFF8F8",
              borderRadius: "10px",
              borderOutline: "none",
            }}
          >
            <FormControl fullWidth>
              <InputLabel id="account-type-label">Account Type</InputLabel>
              <Select
                labelId="account-type-label"
                id="account-type"
                value={accountType}
                label="Account Type"
                onChange={handleChange}
              >
                <MenuItem value="student">Student</MenuItem>
                <MenuItem value="landlord">Landlord</MenuItem>
              </Select>
            </FormControl>
          </Box>
        </div>
      </section>
    </>
  );
}

export default Signup1;
